import logo from './logo.svg';
import './App.css';
import React from 'react';
// import Item from './MyItem';


class StarWars extends React.Component { 
  constructor() {
    super()
    this.state = {
      name: null,
      height: null,
      homeworld: null,
      films: [],

    }
  }
  getNewCharacter() {
    console.log("get new character from a button")
    this.setState({
      name: null,
      height: null,
      homeworld: null,
      films: [],
    })
  }
  render() {
    return (
      <div>
        <h1></h1>
        <p>Height cm</p>
        <p>Homeworld: URL</p>
        <ul>
          <li>
            Films in here 
          </li>
        </ul>
        <button type="button" 
        onClick={() => this.getNewCharacter()}
        className="btn">Randomize Character</button>
      </div>
    )
  }
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <StarWars />
      </header>
    </div>
  );
}

export default App;
